import React from "react";
import Navbar from "../components/Navbar";
import "../styles/onboarding.css";

function Onboarding() {
  return (
    <div className="onboarding-container">
      <Navbar />
      <h1>Onboarding</h1>
      <p>Start your journey with MAEKNIT...</p>
    </div>
  );
}

export default Onboarding;
